import Header from './header'
import style from './index.module.css'


function Contato() {

    function sendForm(e) {
        e.preventDefault()
        // Fazer requisiçao no back-end e enviar o formulario
    }

    return (
    <div>
        <style jsx global>{`
            * {
                margin: 0;
                padding: 0;
                box-sizing: border-box;
            }

            body {
                background-color: rgb(225,225,225);
            }

            form {
                width: 40%;
                max-width: 500px;
                padding: 20px;
                background: white;
            }
        `}</style>
        <Header></Header>
        <div className="form">
            <form onSubmit={(e)=>sendForm(e)}>
                <input placeholder="seu Nome..." type="text" />
                <input placeholder="seu E-mail..." type="text" />
                <textarea placeholder="Sua menssagem..."></textarea>
                <input value="Enviar!" type="submit" />
            </form>
        </div>
    </div>)
}
  
export default Contato
